import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/esm/Container';

function headers() {
  return (
    <Container fluid className=" text-start"style={{height:'4rem'}}>
       <div className='text-start text-white p-3' style={{ backgroundColor:'white' }}></div> 
    </Container>
    
  );
}

export default headers;
